DROP TABLE IF EXISTS `bu_benison_type`;
CREATE TABLE `bu_benison_type` (
`type_id`  varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '祝福语类型ID' ,
`type_code`  varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '祝福语类型编号' ,
`type_name`  varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '名称' ,
`effect_flag`  char(1) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '是否有效（0-无效，1-有效）' ,
`sort_num`  int(11) NULL DEFAULT NULL COMMENT '排序' ,
PRIMARY KEY (`type_id`)
)
ENGINE=InnoDB
DEFAULT CHARACTER SET=utf8 COLLATE=utf8_general_ci
COMMENT='祝福语类型'

;

