-- ----------------------------
-- Table structure for `bu_commodity`
-- ----------------------------
DROP TABLE IF EXISTS `bu_commodity`;
CREATE TABLE `bu_commodity` (
`commodity_id`  varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '商品ID' ,
`commodity_code`  varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '商品编号' ,
`commodity_name`  varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '名称' ,
`commodity_description`  varchar(100) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '描述' ,
`commodity_type`  char(1) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '类型：1-轮播，2-点播' ,
`commodity_status`  char(1) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '状态：1-正常，2-下架' ,
`commodity_price`  decimal(10,2) NULL DEFAULT NULL COMMENT '价格' ,
`commodity_img`  varchar(256) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '图片' ,
`screen_id`  varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '屏幕ID' ,
`start_date`  varchar(10) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '开始日期' ,
`end_date`  varchar(10) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '结束日期' ,
`time_frame`  char(1) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '时间频度' ,
`start_time`  varchar(5) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '开始时间' ,
`end_time`  varchar(5) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '结束时间' ,
`shelf_time`  varchar(5) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '下架时间' ,
`plan_number`  int(11) NULL DEFAULT NULL COMMENT '计划售卖数量' ,
`single_time`  int(11) NULL DEFAULT NULL COMMENT '单次播放时间：15秒的整数倍' ,
`play_times`  int(11) NULL DEFAULT NULL COMMENT '播放次数' ,
`created_time`  datetime NULL DEFAULT NULL COMMENT '创建日期' ,
`created_by`  varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '创建人员' ,
`modified_time`  datetime NULL DEFAULT NULL COMMENT '修改日期' ,
`modified_by`  varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '修改人员' ,
`version`  int(11) NULL DEFAULT NULL COMMENT '版本：创建时是1，更新一次加1' ,
`delflag`  char(1) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '删除标记：0-删除，1-有效，创建时为1' ,
PRIMARY KEY (`commodity_id`)
)
ENGINE=InnoDB
DEFAULT CHARACTER SET=utf8 COLLATE=utf8_general_ci
COMMENT='商品'

;

