-- ----------------------------
-- Table structure for `bu_coupon_type`
-- ----------------------------
DROP TABLE IF EXISTS `bu_coupon_type`;
CREATE TABLE `bu_coupon_type` (
`coupon_type_id`  varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '优惠码类型ID' ,
`coupon_type_code`  varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '优惠码类型编号' ,
`coupon_name`  varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '名称' ,
`coupon_type`  char(1) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '类型（0-特价、1-折扣、2-抵扣）' ,
`valid_type`  char(1) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '是否有效(0-有效、1-无效)' ,
`publish_type`  char(1) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '是否发布（0-已发布、1-未发布）' ,
`special_offer`  decimal(10,2) NULL DEFAULT NULL COMMENT '特价金额' ,
`discount`  decimal(10,2) NULL DEFAULT NULL COMMENT '折扣比例' ,
`deduction`  decimal(10,2) NULL DEFAULT NULL COMMENT '抵减金额' ,
`screen_ids`  varchar(500) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '屏幕' ,
`commodity_ids`  varchar(500) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '商品' ,
`benison_type_ids`  varchar(500) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '祝福类型' ,
`created_time`  datetime NULL DEFAULT NULL COMMENT '创建日期' ,
`created_by`  varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '创建人员' ,
`modified_time`  datetime NULL DEFAULT NULL COMMENT '修改日期' ,
`modified_by`  varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '修改人员' ,
`version`  int(11) NULL DEFAULT NULL COMMENT '版本：创建时是1，更新一次加1' ,
`delflag`  char(1) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '删除标记：0-删除，1-有效，创建时为1' ,
PRIMARY KEY (`coupon_type_id`)
)
ENGINE=InnoDB
DEFAULT CHARACTER SET=utf8 COLLATE=utf8_general_ci

;

