-- ----------------------------
-- Table structure for `bu_order_detail`
-- ----------------------------
DROP TABLE IF EXISTS `bu_order_detail`;
CREATE TABLE `bu_order_detail` (
`detail_id`  varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '明细ID' ,
`order_id`  varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '订单ID' ,
`commodity_id`  varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '商品ID' ,
`commodity_code`  varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '商品编号' ,
`commodity_name`  varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '商品名称' ,
`commodity_description`  varchar(100) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '商品描述' ,
`commodity_price`  decimal(10,2) NULL DEFAULT NULL COMMENT '商品价格' ,
`play_date`  varchar(10) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '播放日期' ,
`time_start`  varchar(5) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '开始时间' ,
`time_end`  varchar(5) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '结束时间' ,
`single_time`  int(11) NULL DEFAULT NULL COMMENT '单次播放时间：15秒的整数倍' ,
`play_times`  int(11) NULL DEFAULT NULL COMMENT '播放次数' ,
`sku_id`  varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '商品SKUID' ,
`sku_code`  varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '商品SKU编号' ,
`sku_name`  varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '商品SKU名称' ,
`sku_description`  varchar(100) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '商品SKU描述' ,
`sku_price`  decimal(10,2) NULL DEFAULT NULL COMMENT '商品SKU价格' ,
`export_by`  varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '导出人员' ,
`export_id`  varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '导出人员ID' ,
`export_time`  varchar(19) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '导出时间：yyyy-mm-dd hh:mm:ss' ,
`created_time`  datetime NULL DEFAULT NULL COMMENT '创建日期' ,
`created_by`  varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '创建人员' ,
`modified_time`  datetime NULL DEFAULT NULL COMMENT '修改日期' ,
`modified_by`  varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '修改人员' ,
`version`  int(11) NULL DEFAULT NULL COMMENT '版本：创建时是1，更新一次加1' ,
`delflag`  char(1) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '删除标记：0-删除，1-有效，创建时为1' ,
PRIMARY KEY (`detail_id`),
FOREIGN KEY (`order_id`) REFERENCES `bu_order` (`order_id`) ON DELETE RESTRICT ON UPDATE RESTRICT,
INDEX `FK_Reference_17` (`order_id`) USING BTREE 
)
ENGINE=InnoDB
DEFAULT CHARACTER SET=utf8 COLLATE=utf8_general_ci
COMMENT='订单明细'

;

