DROP TABLE IF EXISTS `bu_promotion_detail`;
CREATE TABLE `bu_promotion_detail` (
`detail_id`  varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '明细ID' ,
`promotion_id`  varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '促销活动ID' ,
`commodity_id`  varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '商品ID' ,
`commodity_num`  int(11) NULL DEFAULT NULL COMMENT '可促销的商品个数' ,
`discount_ratio`  float NULL DEFAULT NULL COMMENT '打折比例：取值[0,100],0为免费，100为原价；' ,
`created_time`  datetime NULL DEFAULT NULL COMMENT '创建日期' ,
`created_by`  varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '创建人员' ,
`modified_time`  datetime NULL DEFAULT NULL COMMENT '修改日期' ,
`modified_by`  varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '修改人员' ,
`version`  int(11) NULL DEFAULT NULL COMMENT '版本：创建时是1，更新一次加1' ,
`delflag`  char(1) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '删除标记：0-删除，1-有效，创建时为1' ,
PRIMARY KEY (`detail_id`),
FOREIGN KEY (`promotion_id`) REFERENCES `bu_promotion` (`promotion_id`) ON DELETE RESTRICT ON UPDATE RESTRICT,
INDEX `FK_Reference_21` (`promotion_id`) USING BTREE 
)
ENGINE=InnoDB
DEFAULT CHARACTER SET=utf8 COLLATE=utf8_general_ci
COMMENT='促销活动明细'

