DROP TABLE IF EXISTS `identifying_code`;
CREATE TABLE `identifying_code` (
`id`  varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL ,
`mobile`  varchar(20) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '手机号' ,
`code`  varchar(100) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '验证码' ,
`type`  char(1) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '类型（1-绑定手机号）' ,
`send_time`  datetime NULL DEFAULT NULL COMMENT '发送时间' ,
`CREATOR`  int(11) NULL DEFAULT NULL COMMENT '创建人' ,
`CREATE_TIME`  datetime NULL DEFAULT NULL COMMENT '创建时间' ,
`LAST_MODBY`  int(11) NULL DEFAULT NULL COMMENT '最后修改人' ,
`LAST_MODTIME`  datetime NULL DEFAULT NULL COMMENT '最后修改时间' ,
PRIMARY KEY (`id`)
)
ENGINE=InnoDB
DEFAULT CHARACTER SET=utf8 COLLATE=utf8_general_ci
COMMENT='用户与角色关系表'

